import React, { useState } from 'react';
import { mockNhost } from '../graphql';

// Simple Shape components for the background animation
const Shape = ({ className }) => <div className={`absolute block bg-white/10 rounded-full ${className}`} />;

export default function AuthPage({ onLogin }) {
  const [isLogin, setIsLogin] = useState(true);
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setLoading(true);
    const { error: authError } = isLogin 
      ? await mockNhost.auth.signIn({ email, password })
      : await mockNhost.auth.signUp({ email, password });
    
    setLoading(false);
    if (authError) {
      setError(authError.message);
    } else {
      onLogin();
    }
  };

  return (
    // Main container with animated gradient background
    <div className="relative flex items-center justify-center min-h-screen overflow-hidden bg-gradient-to-br from-gray-900 via-purple-900 to-gray-900">
      
      {/* Animated Shapes */}
      <div className="absolute inset-0 w-full h-full z-0">
        <Shape className="w-40 h-40 top-1/4 left-1/4 animate-blob" />
        <Shape className="w-20 h-20 top-1/2 left-2/3 animate-blob animation-delay-2000" />
        <Shape className="w-32 h-32 bottom-1/4 right-1/4 animate-blob animation-delay-4000" />
        <Shape className="w-16 h-16 bottom-10 left-10 animate-blob animation-delay-1000" />
        <Shape className="w-24 h-24 top-10 right-10 animate-blob animation-delay-3000" />
      </div>

      {/* Glassmorphism Form Card */}
      <div className="relative z-10 w-full max-w-md p-8 space-y-6 bg-white/10 backdrop-blur-xl rounded-2xl shadow-2xl border border-white/20">
        <h2 className="text-3xl font-bold text-center text-white">
          {isLogin ? 'Welcome Back' : 'Create Account'}
        </h2>
        <form className="space-y-6" onSubmit={handleSubmit}>
          <div>
            <label htmlFor="email" className="text-sm font-medium text-slate-200">
              Email address
            </label>
            <input
              id="email"
              name="email"
              type="email"
              autoComplete="email"
              required
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              // Glassmorphism input fields
              className="w-full px-4 py-3 mt-1 text-white bg-black/20 border-2 border-white/20 rounded-lg shadow-sm focus:outline-none focus:ring-2 focus:ring-pink-500 focus:border-pink-500 placeholder:text-slate-400"
            />
          </div>
          <div>
            <label htmlFor="password" className="text-sm font-medium text-slate-200">
              Password
            </label>
            <input
              id="password"
              name="password"
              type="password"
              autoComplete={isLogin ? "current-password" : "new-password"}
              required
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              // Glassmorphism input fields
              className="w-full px-4 py-3 mt-1 text-white bg-black/20 border-2 border-white/20 rounded-lg shadow-sm focus:outline-none focus:ring-2 focus:ring-pink-500 focus:border-pink-500 placeholder:text-slate-400"
            />
          </div>
          {error && <p className="text-sm font-semibold text-red-400">{error}</p>}
          <div>
            <button
              type="submit"
              disabled={loading}
              // Vibrant gradient button
              className="w-full px-4 py-3 text-base font-bold text-white bg-gradient-to-r from-purple-600 to-pink-600 hover:from-purple-700 hover:to-pink-700 border border-transparent rounded-lg shadow-lg focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-offset-slate-900 focus:ring-pink-500 disabled:opacity-50 transition-all transform hover:scale-105"
            >
              {loading ? 'Processing...' : (isLogin ? 'Sign In' : 'Sign Up')}
            </button>
          </div>
        </form>
        <p className="text-sm text-center text-slate-400">
          {isLogin ? "Don't have an account?" : 'Already have an account?'}
          {/* Vibrant link color */}
          <button onClick={() => setIsLogin(!isLogin)} className="ml-1 font-bold text-pink-400 hover:text-pink-300">
            {isLogin ? 'Sign Up' : 'Sign In'}
          </button>
        </p>
      </div>
    </div>
  );
}
